window.bookSummaryJSON = "<p><b>For a private investigator on the trail of a missing girl, every second counts in a gripping thriller by </b><b><i>New York Times</i></b><b> bestselling author T.R. Ragan.</b></p> <p>On her first day of kindergarten, five-year-old Tinsley disappeared without a trace...</p> <p>Five agonizing years later, her divorced mother, Dani Callahan, is a private investigator. She and Quinn Sullivan, a promising young assistant determined to prove herself, are devoted to helping others find missing loved ones. And for Dani, finding Tinsley is still a never-ending obsession.</p> <p>Their newest case is Ali Cross, a teenager who vanished off a Sacramento street while walking home. A troubled boy’s eyewitness testimony to Ali’s abduction provides their only clues. And as their search for Ali gets underway, new information about Tinsley’s disappearance begins to surface too.</p> <p>As their investigations lead down two twisting paths, disturbing secrets are revealed and new victims find themselves in mortal danger. Time is running out, and the hunt is only getting grimmer.</p>"; 
